class Solution(object):
    def minimumChanges(self, s, k):
        def changes_to_semi_palindrome(s):
            n = len(s)
            if n == 1: return 0
            changes = 0
            for length in range(2, n+1):
                if n % length == 0:
                    for start in range(length):
                        count = [0] * 26
                        for i in range(start, n, length):
                            count[ord(s[i]) - ord('a')] += 1
                        changes += sum(count) - max(count)
                    return changes // (n // length)
            return 0

        n = len(s)
        dp = [[float('inf')] * (k+1) for _ in range(n+1)]
        dp[0][0] = 0

        for i in range(1, n+1):
            for j in range(1, min(i, k)+1):
                if j == 1:
                    dp[i][j] = changes_to_semi_palindrome(s[:i])
                else:
                    for p in range(j-1, i):
                        dp[i][j] = min(dp[i][j], dp[p][j-1] + changes_to_semi_palindrome(s[p:i]))

        return dp[n][k]
